import React from "react";
import ActivityTracker from "./ActivityTracker";
import YogaMeditation from "./YogaMeditation";
import AppointmentScheduler from "./AppointmentScheduler";
import ChatWithTherapist from "./ChatWithTherapist";
import MedicationReminder from "./MedicationReminder";
import ProgressDashboard from "./ProgressDashboard";
import DailyJournal from "./DailyJournal";
import EducationalResources from "./EducationalResources";

const Dashboard = () => {
  return (
    <div className="container-fluid py-4">
      <h2 className="text-center fw-bold mb-5" style={{ fontSize: "2.5rem", color: "#333" }}>
        Patient Dashboard
      </h2>
      <div className="row g-4">
        {/* Activity Tracker */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1568605117036-5fe5e7bab0b7?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Activity Tracker</h3>
            <p>Keep track of your daily activities, mood, and sleep.</p>
          </div>
        </div>

        {/* Yoga Meditation */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1543352634-515f5ea36100?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Yoga & Meditation</h3>
            <p>Find inner peace with guided yoga and meditation sessions.</p>
          </div>
        </div>

        {/* Appointment Scheduler */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1553456558-aff63285bddb?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">My Appointments</h3>
            <p>View your upcoming appointments and manage bookings.</p>
          </div>
        </div>

        {/* Chat With Therapist */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1586281380418-36ef207cf120?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Chat With Therapist</h3>
            <p>Connect with a therapist anytime for support and guidance.</p>
          </div>
        </div>

        {/* Medication Reminder */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1580281658628-5e01b1f83c79?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Medication Reminder</h3>
            <p>Stay on top of your medications with helpful reminders.</p>
          </div>
        </div>

        {/* Progress Dashboard */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1586281380418-36ef207cf120?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Progress Dashboard</h3>
            <p>Monitor your progress and achieve your health goals.</p>
          </div>
        </div>

        {/* Daily Journal */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1519608487953-e999c86e7455?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Daily Journal</h3>
            <p>Reflect on your day and jot down your thoughts.</p>
          </div>
        </div>

        {/* Educational Resources */}
        <div className="col-lg-4 col-md-6">
          <div
            className="p-4 rounded shadow-sm text-white"
            style={{
              backgroundImage:
                "url('https://images.unsplash.com/photo-1498075702571-ecb018f3752d?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1080')",
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "250px",
            }}
          >
            <h3 className="fw-bold">Educational Resources</h3>
            <p>Explore helpful articles and resources for your mental health.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
